import React from 'react';
import { Link } from 'react-router-dom';
import ProfileSide from './ProfileSide';
import './ProfilePage.css';

const ProfilePage = () => {
	// const [onProfile, setOnProfile] = useState({
	// 	onProfile: true
	// });

	const user = {
		firstName: 'Rodger',
		lastName: 'Retanal',
		email: 'rodger@email.com',
		phone: '420-666-6969',
		joined: '2020'
	};

	const profileNav = [
		{
			label: 'History',
			link: '/past-booking'
		}
	];

	return (
		<div className='profileContainer'>
			<div className='profileSide'>
				<ProfileSide user={user} />
			</div>
			<div className='profileContent'>
				<div className='profileHeader'>
					<div className='headerContent'>
						<h2>{`Hi, I'm ${user.firstName}`}</h2>
						<p>{`Joined in ${user.joined}`}</p>
					</div>
					<div>
						<Link to='/review'>
							<div className='link'>
								Reviews
							</div>
						</Link>
					</div>
					<div className='profileNav'>
						<ul></ul>
						<div className='lml'></div>
					</div>
				</div>
				<div className='profileMain'>
					<div className='guestContent'>
						Guest Content
					</div>
					<div className='hostContent'>
						Host Content (if applicable)
					</div>
				</div>
			</div>
		</div>
	);
};

export default ProfilePage;
